-- StudentUSI 208, Jackson Kelly, Fall Semester
UPDATE EdFi_Ods.edfi.StudentSectionAssociation
SET EndDate = DATEADD(year, 1, GETDATE())
WHERE BeginDate = '2021-08-23'
	AND LocalCourseCode = 'MATH-08'
	AND SchoolId = '255901044'
	AND SchoolYear = 2022
	AND SectionIdentifier = '25590104406Trad211MATH0812011'
	AND SessionName = '2021-2022 Fall Semester'
